impl Solution {
    pub fn maximum_strong_pair_xor(nums: Vec<i32>) -> i32 {
        let mut max_xor = 0;
        let mut nums = nums;
        nums.sort_unstable();
        for i in 0..nums.len() {
            for j in i..nums.len() {
                if nums[j] - nums[i] <= nums[i] {
                    max_xor = max_xor.max(nums[i] ^ nums[j]);
                } else {
                    break;
                }
            }
        }
        max_xor
    }
}
